let deals = collections['9b7ff0fb-63d2-4c76-9240-28ccc1596686']?.data || [];
if (!Array.isArray(deals) || deals.length === 0) {
  alert("لا توجد صفقات للتصدير");
  return;
}

const headers = [
  "عنوان الصفقة",
  "مرحلة الصفقة",
  "تاريخ الصفقة",
  "الموظف المسئول",
  "الملاحظات",
  "قيمة الصفقة",
  "اسم العميل",
  "عنوان العقار",
  "نوع العقار",
  "سعر العقار",
  "المساحة م/مربع",
  "الدور",
  "غرف النوم",
  "الحمام",
  "مميزات العقار"
];

const rows = deals.map(deal => {
  const statusName = deal.deal_status?.status_name || `ID ${deal.deal_status}`;
  const dealStage = deal.deal_stage?.source_name || `ID ${deal.deal_stage}`;
  const LeadName = deal.leads?.lead_name || `ID ${deal.leads}`;
  const propertyTitle = deal.properties?.property_title || `ID ${deal.properties}`;
  const propertyType = deal.properties?.property_type || `ID ${deal.properties}`;
  const propertyPrice = deal.properties?.price || `ID ${deal.properties}`;
  const propertyArea = deal.properties?.area || `ID ${deal.properties}`;
  const propertyFloor = deal.properties?.floor || `ID ${deal.properties}`;
  const propertyBedrooms = deal.properties?.bedrooms || `ID ${deal.properties}`;
  const propertyBathrooms = deal.properties?.bathrooms || `ID ${deal.properties}`;
  const propertyFeatures = deal.properties?.features || `ID ${deal.properties}`;
  const userName = deal.profiles?.user_name || `ID ${deal.user_id}`;

  return [
    deal.name || "",
    dealStage,
    deal.date,
	userName,
	deal.notes || "",
	deal.amount || "",
	LeadName,
	propertyTitle,
	propertyType,
	propertyPrice,
	propertyArea,
	propertyFloor,
	propertyBedrooms,
	propertyBathrooms,
	propertyFeatures,
  ];
});

const csvContent = [
  headers.join(","),
  ...rows.map(row => row.map(value => `"${value}"`).join(","))
].join("\n");

const BOM = "\uFEFF";
const blob = new Blob([BOM + csvContent], { type: "text/csv;charset=utf-8;" });
const url = URL.createObjectURL(blob);
const link = document.createElement("a");
link.setAttribute("href", url);
link.setAttribute("download", "deals_Export.csv");
link.click();
